import React from 'react';
import Todo from './components/Todo';
import Aux from './hoc/Aux';

import 'bootstrap/dist/css/bootstrap.min.css';
//import uuid from 'uuid';


function App() {
  return (
    <Aux>
      <div></div>

      <div>
        <Todo />
      </div>
    </Aux>
  );
}

export default App;
